import Link from 'next/link';

const linkStyle = {
    margin
}

const Menu = () => {
    return (
        <div>
            <Link href="/">
                <a style={linkStyle}>Home</a>
            </Link>
            <Link href="/about">
                <a style={linkStyle}>About</a>
            </Link>
            <Link href="/contact">
                <a style={linkStyle}>Contact</a>
            </Link>
        </div>
    );
}
export default Menu;
